INSERT INTO `terms_and_policies` (`id`, `terms`, `privacy_policy`, `shipping_policy`, `return_policy`, `created_at`, `updated_at`) VALUES
(1, '<br>', '<br>', '<br>', '<p>Eru BD and Eru smart Tech has a unique return policy if the customer has a change of mind.</p>\r\n\r\n<p>Return Policy (English):</p>\r\n\r\n<p><br>\r\nEligibility for Returns:</p>\r\n\r\n<p>Products can be returned within 7 days from the date of purchase.</p>\r\n\r\n<p>The item must be in unused condition, with original packaging, manuals, and all accessories intact.</p>\r\n\r\n<p>A valid purchase receipt or invoice is required for all returns.</p>\r\n\r\n<p>Non-Returnable Items:</p>\r\n\r\n<p>Items that have been physically damaged or altered by the customer.<br>\r\nEarphones, screen protectors, and other consumable items are not eligible for return.</p>\r\n\r\n<p>Return Process:</p>\r\n\r\n<p>Customers must contact us through our store, website, phone or Facebook page to initiate a return.</p>\r\n\r\n<p>Our Facebook Page is www.fb.com/erubiponi </p>\r\n\r\n<p>Our representative will verify the product if the product is applicable for return. </p>\r\n\r\n<p>After verification, the item can either be exchanged or a store credit can be issued. </p>\r\n\r\n<p>Cash refunds are only available for unavailability of the product. </p>\r\n\r\n<p>Restocking Fee:</p>\r\n\r\n<p>A 13% of restocking and warranty activation fee will be applied to returns without defects. </p>\r\n\r\n<p>1500 taka will be added more with 13% if the warranty is activated( if inserted sim card or connected with internet anyhow)</p>\r\n\r\n<p>Defective Products:</p>\r\n\r\n<p>If the product is found to be defective by the representative, it cannot be exchanged but repaired under the shop warranty.</p>\r\n\r\n<p><br>\r\nইরু বাংলাদেশ বা ইরু স্মার্ট টেক হতে কেনা পন্যের রিটার্ন পলিসি (Bengali):</p>\r\n\r\n<p>ফেরতের যোগ্যতা:</p>\r\n\r\n<p>পণ্যটি ক্রয়ের ৭ দিনের মধ্যে নির্দিষ্ট কিছু শর্ত মেনে ফেরত দেওয়া যাবে।</p>\r\n\r\n<p>১। পণ্যটি অব্যবহৃত অবস্থায় থাকতে হবে।</p>\r\n\r\n<p>২। মূল প্যাকেজিং, ম্যানুয়াল এবং সমস্ত আনুষাঙ্গিক অক্ষত অবস্থায় থাকতে হবে। </p>\r\n\r\n<p>৩। ফেরতের জন্য একটি আউটলেট কর্তৃক ইসকৃত রশিদটি থাকতে হবে। </p>\r\n\r\n<p>যে পণ্য ফেরত দেওয়া যাবে না:</p>\r\n\r\n<p>১। পণ্য যদি গ্রাহক দ্বারা  ক্ষতিগ্রস্থ বা পরিবর্তিত হয়ে থাকে তাহলে পণ্যটি রিটার্ন করা যাবে না। </p>\r\n\r\n<p>২। ইয়ারফোন, স্ক্রিন প্রোটেক্টর, এবং অন্যান্য ব্যবহৃত জিনিস নষ্ট হলে পণ্যটি ফেরার যোগ্য নয় বলে বিবেচিত হবে। </p>\r\n\r\n<p>ফেরত প্রক্রিয়া:</p>\r\n\r\n<p>গ্রাহকরা আমাদের শো-রুম, ওয়েবসাইট, ফোন বা ফেসবুক পেজ এর মাধ্যমে যোগাযোগ করে ফেরত প্রক্রিয়া শুরু করতে পারবেন।</p>\r\n\r\n<p>ফেরত দিতে চাওয়া পণ্যটি আমাদের একজন প্রতিনিধি যাচাই করে সিদ্ধান্ত \r\nনিবেন যে পণ্যটি পরিবর্তন করা যাবে কি না, বা ক্যাশ ক্রেডিট দেওয়া হবে কি \r\nনা। এ বিষয়ে হেরো স্মার্ট টেক কর্তৃপক্ষের নেওয়া সিদ্ধান্ত চূড়ান্ত \r\nসিদ্ধান্ত। পন্যে ত্রুটি পাওয়া গেলে ঐ পন্য ফেরত অযোগ্য বলে বিবেচিত হবে</p>\r\n\r\n<p> সিদ্ধান্ত যদি গ্রহীতা মেনে থাকেন তাহলেই কেবল এই প্রক্রিয়া সম্পন্ন হবে। <br>\r\nক্রেতার দেওয়া কোন সিদ্ধান্ত ইরু স্মার্ট টেক মানতে বাধ্য নয়। </p>\r\n\r\n<p><br>\r\nনগদ টাকা ফেরত শুধুমাত্র পণ্যের রিপ্লেসমেন্ট না থাকলে তখন প্রযোজ্য হবে। এবং তা ক্রয়ের ৩ দিনের মধ্যে করতে হবে।</p>\r\n\r\n<p>রিস্টকিং ফি:</p>\r\n\r\n<p>কোন রকম ত্রুটি ছাড়া ফেরতের জন্য ১৩% রিস্টকিং ফি এবং রি-ওয়ারেন্টি ফি প্রযোজ্য।</p>\r\n\r\n<p>১৩% এর সাথে সাথে ওয়ারেন্টি ভায়োলেশনে হলে(সিম লাগানো হলে বা ইন্টারনেট কানেকশন করা হলে) ১৩% এর সাথে আরো ১৫০০ টাকা যুক্ত হবে।</p>\r\n\r\n<p><br>\r\nত্রুটিযুক্ত পণ্য:</p>\r\n\r\n<p>যদি পণ্যটি ত্রুটিযুক্ত প্রমাণিত হয়, তবে এটি পরিবর্তন বা ফেরত দেওয়া যাবে না। তবে ওয়ারেন্টিনীতিমালা অনুযায়ী মেরামত করা যাবে।</p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\r\n<p> রিটার্ন পলিসির বিষয়ে ইরু স্মার্ট টেক যেকোনো সময় যেকোন পরিবর্তন পরিবর্তন সংযোজন বিয়োজন এর অধিকার সংরক্ষণ করে। </p>\r\n\r\n<p> </p>\r\n\r\n<p> Eru Smart tech has right to change the policy any time without notice.</p>', '2023-04-11 13:41:20', '2024-11-16 10:07:43');
